import style from 'styled-components'


const Button = styled.button`
     background: none;
    padding: 10px;
    width: 100px;
    border-radius: 5px;
    border:2px solid #b4b5b9;
    color:grey;
    &:hover{
        cursor: pointer;
    }
`;
